'use strict';

const { Contract } = require('fabric-contract-api');

class FabCar extends Contract {

    async initLedger(ctx) {
        console.info('============= START : Initialize Ledger ===========');
        const cars = [
            {
                name: 'Blue Toyota',
                description: 'Blue Toyota Automatic with ABS',
                color: 'blue',
                make: 'Toyota',
                price: 5000,
                quantity: 5,
                owner: 'ASAD23',
                image: `data:image/jpeg;base64,`
            },
            {
                name: 'Black Honda City',
                description: 'Automatic with ABS',
                color: 'Black',
                make: 'Honda',
                price: 5000,
                quantity: 5,
                owner: 'ASAD23',
                image: `data:image/jpeg;base64,`
            }
        ];

        for (let i = 0; i < cars.length; i++) {
            cars[i].docType = 'car';
            await ctx.stub.putState('ID' + i, Buffer.from(JSON.stringify(cars[i])));
            console.info('Added <--> ', cars[i]);
        }
        console.info('============= END : Initialize Ledger ===========');
    }

    async queryCar(ctx, ID) {
        const carAsBytes = await ctx.stub.getState(ID); // get the car from chaincode state
        if (!carAsBytes || carAsBytes.length === 0) {
            throw new Error(`${ID} does not exist`);
        }
        console.log(carAsBytes.toString());
        return carAsBytes.toString();
    }

    async createCar(ctx, ID, name, description, color, make, price, quantity, owner,  image, type) {
        console.info('============= START : Create Car ===========');

        const car = {
            name,
            description,
            color,
            docType: type,
            make,
            price,
            owner,
            ID,
            quantity,
            image
        };

        await ctx.stub.putState(ID, Buffer.from(JSON.stringify(car)));
        console.info('============= END : Create Car ===========');
    }

    async queryAllCars(ctx) {
        const startKey = 'ID0';
        const endKey = 'ID9999999';

        const iterator = await ctx.stub.getStateByRange(startKey, endKey);

        const allResults = [];
        while (true) {
            const res = await iterator.next();

            if (res.value && res.value.value.toString()) {
                console.log(res.value.value.toString('utf8'));

                const Key = res.value.key;
                let Record;
                try {
                    Record = JSON.parse(res.value.value.toString('utf8'));
                } catch (err) {
                    console.log(err);
                    Record = res.value.value.toString('utf8');
                }
                allResults.push({ Key, Record });
            }
            if (res.done) {
                console.log('end of data');
                await iterator.close();
                console.info(allResults);
                return JSON.stringify(allResults);
            }
        }
    }

    async changeCarOwner(ctx, ID, newOwner) {
        console.info('============= START : changeCarOwner ===========');

        const carAsBytes = await ctx.stub.getState(ID); // get the car from chaincode state
        if (!carAsBytes || carAsBytes.length === 0) {
            throw new Error(`${ID} does not exist`);
        }
        const car = JSON.parse(carAsBytes.toString());
        car.owner = newOwner;

        await ctx.stub.putState(ID, Buffer.from(JSON.stringify(car)));
        console.info('============= END : changeCarOwner ===========');
    }
	//purchase car code
	async purchaseCar(ctx, ID, newOwner) {
        console.info('============= START : purchaseCar ===========');

        const carAsBytes = await ctx.stub.getState(ID); // get the car from chaincode state
        if (!carAsBytes || carAsBytes.length === 0) {
            throw new Error(`${ID} does not exist`);
        }
        const car = JSON.parse(carAsBytes.toString());
		let value = parseInt(car.price);
		let oldownerName = car.owner
		const newOnwer = JSON.parse(await ctx.stub.getState(oldownerName).toString);
		const oldowner = JSON.parse(await ctx.stub.getState(oldownerName).toString);
		if (price > newOwner.balance) {
			throw new Error(`${newOwner.balane} is not enough for purchasing the car`);
		}
		newOwner.balance = parseInt(newOwner.balance) - value;
        car.owner = newOwner;
		oldowner.balance = parseInt(oldowner.balance) + value;
        await ctx.stub.putState(ID, Buffer.from(JSON.stringify(car)));
        console.info('============= END : purchaseCar ===========');
    }

}

module.exports = FabCar;
